var wProgressBar = angular.module( "wProgressBarAutoProgress",[]);

wProgressBar.controller( "wProgressBarAutoProgressController", function( $scope ) {
    $scope.val1=22;
    var i=22;

  $scope.myDelay = function() {
            $scope.$apply(function(){
                $scope.val1=i})
                i++;
                if(i<101){
                var t = setTimeout(function(){$scope.myDelay()},50);}
        }

   $scope.myDelay();



    $scope.barcolor=[{"class1":"info"},{"class1":"success"},{"class1":"danger"},{"class1":"warning"},{"class1":"default"}];
});
wProgressBar.directive("progressBary", ["$timeout", function ($timeout) {
    return {
        restrict: "EA",
        template:
            "<span class='small'>{{label}}</span>" +
            "<div class='progress'>"+
      "   <div class='progress-bar {{barClass}}' style='width:{{complete/total * 100}}%;'>{{showPercent ? (complete/total*100) : complete | number:0}} {{completeLabel}}</div>" +
            "</div>",
        scope: {
            total: '=total1',
            complete: '=complete1',
          	barClass: '@barClass1',
          	completeLabel: '@completeLabel1'


        },
        link: function (scope, elem, attrs) {

            scope.label = attrs.label1;
            scope.completeLabel = attrs.completeLabel1;
            scope.showPercent = (attrs.showPercent1) || false;


        }

    };
}])
